  //_________________________________________________________________________________
  DC1Q2Q::DC1Q2Q():
    DoubleExpression()
  {
  }
  double DC1Q2Q::LocalLocal(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    return 2*(-4 + Dn(0,x,true)*Dn(0,z,true) + Dn(1,x,true) + Dn(1,z,true))*(NC - NCi);
  };
  double DC1Q2Q::LocalSingular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    return 2*(Dn(1,z) + Dn(0,z)*Dn(0,x,true))*(NC - NCi);
  };
  double DC1Q2Q::LocalRegular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    const double omzi = 1. / ( 1 - z );
    const double lz = log(z);
    const double lomz = log(1 - z);
    return -((NC - NCi)*(-1 + z + (1 + z)*Dn(0,x,true) + (1 + z)*lomz + lz + z*lz - 2*lz*omzi));
  };
  double DC1Q2Q::SingularLocal(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    return 2*(Dn(1,x) + Dn(0,x)*Dn(0,z,true))*(NC - NCi);
  };
  double DC1Q2Q::SingularSingular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    return 2*Dn(0,x)*Dn(0,z)*(NC - NCi);
  };
  double DC1Q2Q::SingularRegular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    return -((1 + z)*Dn(0,x)*(NC - NCi));
  };
  double DC1Q2Q::RegularLocal(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    const double omxi = 1. / ( 1 - x );
    const double lx = log(x);
    const double lomx = log(1 - x);
    return -((NC - NCi)*(-1 + x + (1 + x)*Dn(0,z,true) + (1 + x)*lomx - lx - x*lx + 2*lx*omxi));
  };
  double DC1Q2Q::RegularSingular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    return -((1 + x)*Dn(0,z)*(NC - NCi));
  };
  double DC1Q2Q::RegularRegular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    return 2*(x + z)*(NC - NCi);
  };

  //_________________________________________________________________________________
  DC1Q2G::DC1Q2G():
    DoubleExpression()
  {
  }
  double DC1Q2G::LocalRegular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    const double zi = 1. / z;
    const double lz = log(z);
    const double lomz = log(1 - z);
    return ((NC - NCi)*(z - 2*lz + z*lz + 2*lz*zi + Dn(0,x,true)*(-2 + z + 2*zi) + lomz*(-2 + z + 2*zi)));
  };
  double DC1Q2G::SingularRegular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    const double zi = 1. / z;
    return (Dn(0,x)*(NC - NCi)*(-2 + z + 2*zi));
  };
  double DC1Q2G::RegularRegular(double const& x, double const& z) const
  {
    const double NCi = 1. / NC;
    const double zi = 1. / z;
    return -((NC - NCi)*(-2*(1 + x - z) + (1 + x)*zi));
  };

  //_________________________________________________________________________________
  DC1G2Q::DC1G2Q():
    DoubleExpression()
  {
  }
  double DC1G2Q::RegularLocal(double const& x, double const& z) const
  {
    const double lx = log(x);
    const double lomx = log(1 - x);
    return 2*(-0.5 + x)*Dn(0,z,true) + (2 - 2*x + (-1 + 2*x)*lomx + lx - 2*x*lx);
  };
  double DC1G2Q::RegularSingular(double const& x, double const& z) const
  {
    return 2*(-0.5 + x)*Dn(0,z);
  };
  double DC1G2Q::RegularRegular(double const& x, double const& z) const
  {
    const double zi = 1. / z;
    return (-1 + 2*x)*(-2 + zi);
  };

